  commenter: {
    fontStyle: "bold",
  },
}))

const Comment = (props) => {
  const classes = useStyles()
  return (
    <div>
      <Card variant="outlined">
        <CardContent>
          <Typography className={classes.commenter} component="h5" variant="h5">
            Adam Rodrigues -
          </Typography>{" "}
          {props.comment}
        </CardContent>
      </Card>
    </div>
  )
}

